import java.util.*;
class Solution {
    public void solve(String input) {
        String[] parts = input.split("\\s+");
        if (parts.length < 2) { System.out.println("0"); return; }
        String num1 = parts[0], num2 = parts[1];
        if (num1.equals("0") || num2.equals("0")) { System.out.println("0"); return; }
        int[] res = new int[num1.length() + num2.length()];
        for (int i = num1.length() - 1; i >= 0; i--) {
            for (int j = num2.length() - 1; j >= 0; j--) {
                int mul = (num1.charAt(i) - '0') * (num2.charAt(j) - '0');
                int p1 = i + j, p2 = i + j + 1;
                int sum = mul + res[p2];
                res[p2] = sum % 10;
                res[p1] += sum / 10;
            }
        }
        StringBuilder sb = new StringBuilder();
        for (int p : res) if (!(sb.length() == 0 && p == 0)) sb.append(p);
        System.out.println(sb.length() == 0 ? "0" : sb.toString());
    }
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        if (sc.hasNextLine()) new Solution().solve(sc.nextLine().trim());
    }
}

